import gal1 from '../assets/gal1.jpeg.png';
import {Component} from "react";
// import bikeImg from '../img/bike.png'
// import swimImg from '../img/swim.png'

export default class DataArticle extends Component {

    render() {
        // let iconObj =
        //     {"run": runImg, "bike": bikeImg, "swim": swimImg}

        const staff = [
            {
                id: "1",
                url: gal1,
                title: 'Snorkeling',
                width: '40%',
            },
            {
                id: "2",
                url:
                    'https://images.unsplash.com/photo-1531299204812-e6d44d9a185c?auto=format&fit=crop&w=400&q=80',
                title: 'Massage',
                width: '20%',
            },
            {
                id: "3",
                url:
                    'https://images.unsplash.com/photo-1476480862126-209bfaa8edc8?auto=format&fit=crop&w=400&q=80',
                title: 'Hiking',
                width: '40%',
            },
            {
                id: "4",
                url:
                    'https://images.unsplash.com/photo-1453747063559-36695c8771bd?auto=format&fit=crop&w=400&q=80',
                title: 'Tour',
                width: '38%',
            },
            {
                id: "5",
                url:
                    'https://images.unsplash.com/photo-1523309996740-d5315f9cc28b?auto=format&fit=crop&w=400&q=80',
                title: 'Gastronomy',
                width: '38%',
            },
            {
                id: "6",
                url:
                    'https://images.unsplash.com/photo-1534452203293-494d7ddbf7e0?auto=format&fit=crop&w=400&q=80',
                title: 'Shopping',
                width: '24%',
            },
            {
                id: "7",
                url:
                    'https://images.unsplash.com/photo-1506941433945-99a2aa4bd50a?auto=format&fit=crop&w=400&q=80',
                title: 'Walking',
                width: '40%',
            },
            {
                id: "8",
                url:
                    'https://images.unsplash.com/photo-1533727937480-da3a97967e95?auto=format&fit=crop&w=400&q=80',
                title: 'Fitness',
                width: '20%',
            },
            {
                id: "9",
                url:
                    'https://images.unsplash.com/photo-1518136247453-74e7b5265980?auto=format&fit=crop&w=400&q=80',
                title: 'Reading',
                width: '40%',
            },
        ];
        return (
            <div>
            <img
                alt={this.props.title}
                src={staff[this.props.url]}
                />
                <div>{this.props.title}</div>
            </div>
        )
    }
}
